import BearContainer from "./BearContainer";

const BearRow = (props) => {
  return (
    <div className="row">
      <div tabIndex="0" className="upper symbol-box">
        <h2 id="symbol">{props.data.name}</h2>
        <p className="price">Price: ${props.data.price}</p>
        <div className="changes-row">
          <p className="">${props.data.percentage}%</p>
          <img id="upArrow" src="./images/downArrow.svg" />
          <p>${props.data.change}</p>
        </div>
      </div>
    </div>
  );
};

export default BearRow;
